import { MDBRow, MDBCol, MDBContainer } from 'mdb-react-ui-kit';
import Movie from './movie';
import { useTypedSelector } from '../hooks/useTypedSelector';

const MovieGrid = () => {
    const { data, error, loading } = useTypedSelector(
        (state) => state.repositories
    );

    return (
        <div>
            {error && <h3 className="text-white">{error}</h3>}
            {loading && <h3>Loading...</h3>}
            {!error && !loading && (
                <MDBContainer fluid>
                    <MDBRow className="col-12  g-3 m-0">
                        <MDBCol>
                            <Movie
                                name="Mad Max: Estrada da Fúria"
                                imageSRC="/tH64gzAHDFg7EFcgfkkZyHdGM5P.jpg"
                                releaseDate="13/05/2015"
                                budget={150000000}
                                revenue={378858340}
                                rating={7.5}
                            />
                        </MDBCol>
                        <MDBCol>
                            <Movie
                                name="Clube da Luta"
                                imageSRC="/pB8BM7pdSp6B6Ih7QZ4DrQ3PmJK.jpg"
                                releaseDate="15/10/1999"
                                budget={63000000}
                                revenue={100853753}
                                rating={8.4}
                            />
                        </MDBCol>
                        <MDBCol>
                            <Movie
                                name="Cães de Aluguel"
                                imageSRC="/84dzLDiFiACIqKtqQwzmB6GL7uC.jpg"
                                releaseDate="02/09/1992"
                                budget={1200000}
                                revenue={2859750}
                                rating={8.1}
                            />
                        </MDBCol>
                        <MDBCol>
                            <Movie
                                name="Gaiola das Loucas"
                                imageSRC="/esSA2kSLCl91mjyz0JBkBijHchq.jpg"
                                releaseDate="08/03/1996"
                                budget={31000000}
                                revenue={185260553}
                                rating={7.0}
                            />
                        </MDBCol>
                    </MDBRow>
                </MDBContainer>
            )}
        </div>
    );
};

export default MovieGrid;
